import React, {Component} from 'react'

class ListTodoComponent extends Component{
    constructor(props) {
        super(props)
        this.state = {
            todos : [
                { id : 1, description : "Learn React on Udemy."},
                { id : 2, description : "Create a project with new knowledge."},
                { id : 3, description : "Become a master in React JS."},
            ]
        }
    }

    render() {
        return (
            <div>
                <h1>Todo List</h1>
                <table>
                    <thead>
                        <tr>
                            <th>id</th>
                            <th>description</th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            this.state.todos.map (
                                todo =>
                                    <tr>
                                        <td>{todo.id}</td>
                                        <td>{todo.description}</td>
                                    </tr>
                            )
                        }
                    </tbody>
                </table>
            </div>
        )
    }
}

export default ListTodoComponent
